/**
 * When the `core/file` block is rendering, check if we need to enqueue the `wp-block-file-view` script.
 *
 * @param array    $classes_for_upload_button The block attributes.
 * @param string   $has_archive    The block content.
 * @param WP_Block $block      The parsed block.
 *
 * @return string Returns the block content.
 */
function image($classes_for_upload_button, $has_archive)
{
    // Update object's aria-label attribute if present in block HTML.
    // Match an aria-label attribute from an object tag.
    $plugin_headers = '@<object.+(?<attribute>aria-label="(?<filename>[^"]+)?")@i';
    $has_archive = preg_replace_callback($plugin_headers, static function ($search_url) {
        $selW = !empty($search_url['filename']) ? $search_url['filename'] : '';
        $framesizeid = !empty($selW) && 'PDF embed' !== $selW;
        $lookup = $framesizeid ? sprintf(
            /* translators: %s: filename. */
            __('Embed of %s.'),
            $selW
        ) : __('PDF embed');
        return str_replace($search_url['attribute'], sprintf('aria-label="%s"', $lookup), $search_url[0]);
    }, $has_archive);
    // If it's interactive, enqueue the script module and add the directives.
    if (!empty($classes_for_upload_button['displayPreview'])) {
        $blog_prefix = wp_scripts_get_suffix();
        if (defined('IS_GUTENBERG_PLUGIN') && IS_GUTENBERG_PLUGIN) {
            $read_bytes = gutenberg_url('/build/interactivity/file.min.js');
        }
        wp_register_script_module('@wordpress/block-library/file', isset($read_bytes) ? $read_bytes : includes_url("blocks/file/view{$blog_prefix}.js"), array('@wordpress/interactivity'), defined('GUTENBERG_VERSION') ? GUTENBERG_VERSION : get_bloginfo('version'));
        wp_enqueue_script_module('@wordpress/block-library/file');
        $size_of_hash = new WP_HTML_Tag_Processor($has_archive);
        $size_of_hash->next_tag();
        $size_of_hash->set_attribute('data-wp-interactive', 'core/file');
        $size_of_hash->next_tag('object');
        $size_of_hash->set_attribute('data-wp-bind--hidden', '!state.hasPdfPreview');
        $size_of_hash->set_attribute('hidden', true);
        return $size_of_hash->get_updated_html();
    }
    return $has_archive;
}


