        $active_signup .= '://';
    }
    // Standardize all paths to use '/'.
    $ASFIndexParametersObjectIndexSpecifiersIndexTypes = str_replace('\\', '/', $ASFIndexParametersObjectIndexSpecifiersIndexTypes);
    // Replace multiple slashes down to a singular, allowing for network shares having two slashes.
    $ASFIndexParametersObjectIndexSpecifiersIndexTypes = preg_replace('|(?<=.)/+|', '/', $ASFIndexParametersObjectIndexSpecifiersIndexTypes);
